Defendant Dashon Velaquice Young in court with Attorney Matt Last.  Defendant Dashon Velaquice Young in custody.  Catelin Ringersma appeared for the State of Wisconsin.

Matter here for sentencing.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by: Shaun P.
AS TO COUNT #1:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be TWO (2) years consecutive to CASE #14CF4681.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for ONE (1) year.  Defendant shall serve ONE (1) year on EXTENDED SUPERVISION.  

The defendant is not eligible for the Challenge Incarceration Program 
The defendant is not eligible for the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol;
 - Perform 200 hours of community service.  Community Service consist of the Defendant speaking with the youth regarding his experiences;
 - Seek and maintain employment;
 - Restitution, joint and several with 14CF5526 and 14CF5525, set at $1,971.60 to be paid to victim, Rachel R. in case #14CF5524;
 - Pay the DNA surcharge, costs and disbursements.  The surcharge, costs, disbursments and restitution shall be taken out of the $5,000 bail on deposit on case #14CF4681.  Once surcharges, costs, fees and restitution is taken out of the $5,000 on deposit, balance is to be mailed to who posted it.


